-- Дамп структуры для представление test.ac_view_achievs_list
-- Удаление временной таблицы и создание окончательной структуры представления
DROP TABLE IF EXISTS `ac_view_achievs_list`;
CREATE VIEW `ac_view_achievs_list` AS select `a`.`id` AS `id`,`a`.`type` AS `type`,`a`.`count` AS `count`,`a`.`icon` AS `icon`,`al`.`lid` AS `lid`,`al`.`achievid` AS `achievid`,`al`.`lang` AS `lang`,`al`.`name` AS `name`,`al`.`desc` AS `desc` from (`ac_achievs` `a` join `ac_achievs_lang` `al`) where (`a`.`id` = `al`.`achievid`);

-- Дамп структуры для представление test.cs_view_servers
-- Удаление временной таблицы и создание окончательной структуры представления
DROP TABLE IF EXISTS `cs_view_servers`;
CREATE VIEW `cs_view_servers` AS select `s`.`id` AS `id`,`s`.`mod` AS `mod`,`s`.`addres` AS `addres`,`s`.`vip` AS `vip`,`s`.`name` AS `name`,`s`.`map` AS `map`,`s`.`players` AS `players`,`s`.`max_players` AS `max_players`,`s`.`update` AS `update`,`sm`.`modname` AS `modname` from (`cs_servers` `s` left join `cs_servers_mod` `sm` on((`s`.`mod` = `sm`.`mid`))) order by `s`.`vip` desc,`s`.`name`;

-- Дамп структуры для представление test.kz_view_map_list
-- Удаление временной таблицы и создание окончательной структуры представления
DROP TABLE IF EXISTS `kz_view_map_list`;
CREATE VIEW `kz_view_map_list` AS select `kz_map`.`mapname` AS `mapname`,`kz_map`.`diff` AS `diff`,`kz_map`.`type` AS `type`,`kz_map`.`sc` AS `sc`,`kz_map`.`authors` AS `authors`,`kz_map`.`date_old` AS `date_old`,`kz_map`.`comm` AS `comm`,`kz_map`.`locked` AS `locked` from `kz_map` where (`kz_map`.`locked` = 0);

-- Дамп структуры для представление test.kz_view_map_top
-- Удаление временной таблицы и создание окончательной структуры представления
DROP TABLE IF EXISTS `kz_view_map_top`;
CREATE VIEW `kz_view_map_top` AS select `t`.`id` AS `id`,`t`.`map` AS `map`,`t`.`player` AS `player`,`t`.`time` AS `time`,`t`.`cp` AS `cp`,`t`.`go_cp` AS `go_cp`,`t`.`weapon` AS `weapon`,`t`.`time_add` AS `time_add`,`p`.`username` AS `username`,`w`.`wname` AS `wname`,`w`.`pspeed` AS `pspeed`,`d`.`dname` AS `dname`,`d`.`ddot` AS `ddot`,`d`.`dcolor` AS `dcolor`,`d`.`icon` AS `icon` from ((((`kz_map_top` `t` join `cs_players` `p` on((`p`.`id` = `t`.`player`))) join `kz_weapons` `w` on((`w`.`id` = `t`.`weapon`))) left join `kz_map` `m` on((`m`.`mapname` = `t`.`map`))) left join `kz_diff` `d` on((`m`.`diff` = `d`.`id`)));

-- Дамп структуры для представление test.kz_view_map_top1
-- Удаление временной таблицы и создание окончательной структуры представления
DROP TABLE IF EXISTS `kz_view_map_top1`;
CREATE VIEW `kz_view_map_top1` AS select `t`.`id` AS `id`,`t`.`map` AS `map`,`t`.`player` AS `player`,`t`.`time` AS `time`,`t`.`cp` AS `cp`,`t`.`go_cp` AS `go_cp`,`t`.`weapon` AS `weapon`,`t`.`time_add` AS `time_add`,`p`.`username` AS `username`,`w`.`wname` AS `wname`,`w`.`pspeed` AS `pspeed`,`d`.`dname` AS `dname`,`d`.`ddot` AS `ddot`,`d`.`dcolor` AS `dcolor`,`d`.`icon` AS `icon`,replace(`c`.`download`,'%map%',`m`.`mapname`) AS `download`,`m`.`type` AS `type` from ((((((`kz_map_top1` `t` join `cs_players` `p` on((`p`.`id` = `t`.`player`))) join `kz_view_map_top1_min` `tm` on(((`tm`.`minmap` = `t`.`map`) and (`tm`.`mintime` = `t`.`time`)))) left join `kz_weapons` `w` on((`w`.`id` = `t`.`weapon`))) left join `kz_map` `m` on((`m`.`mapname` = `t`.`map`))) left join `kz_diff` `d` on((`m`.`diff` = `d`.`id`))) left join `kz_comm` `c` on((`m`.`comm` = `c`.`name`)));

-- Дамп структуры для представление test.kz_view_map_top1_min
-- Удаление временной таблицы и создание окончательной структуры представления
DROP TABLE IF EXISTS `kz_view_map_top1_min`;
CREATE VIEW `kz_view_map_top1_min` AS select `mt`.`map` AS `minmap`,min(`mt`.`time`) AS `mintime` from `kz_map_top1` `mt` group by `mt`.`map`;

-- Дамп структуры для представление test.kz_view_map_top_min
-- Удаление временной таблицы и создание окончательной структуры представления
DROP TABLE IF EXISTS `kz_view_map_top_min`;
CREATE VIEW `kz_view_map_top_min` AS select `mt`.`map` AS `minmap`,min(`mt`.`time`) AS `mintime` from (`kz_map_top` `mt` left join `kz_weapons` `w` on((`w`.`id` = `mt`.`weapon`))) where (`mt`.`go_cp` = 0) group by `mt`.`map`,`w`.`pspeed` union select `mt`.`map` AS `minmap`,min(`mt`.`time`) AS `mintime` from (`kz_map_top` `mt` left join `kz_weapons` `w` on((`w`.`id` = `mt`.`weapon`))) where (`mt`.`go_cp` > 0) group by `mt`.`map`,`w`.`pspeed`;

-- Дамп структуры для представление test.kz_view_records
-- Удаление временной таблицы и создание окончательной структуры представления
DROP TABLE IF EXISTS `kz_view_records`;
CREATE VIEW `kz_view_records` AS select `r`.`id` AS `id`,`r`.`map` AS `map`,`r`.`mappath` AS `mappath`,`r`.`time` AS `time`,`r`.`player` AS `player`,`r`.`country` AS `country`,`r`.`comm` AS `comm` from (`kz_records` `r` join `kz_view_records_group` `rr` on((`rr`.`id` = `r`.`id`)));

-- Дамп структуры для представление test.kz_view_records_group
-- Удаление временной таблицы и создание окончательной структуры представления
DROP TABLE IF EXISTS `kz_view_records_group`;
CREATE VIEW `kz_view_records_group` AS select min(`r`.`id`) AS `id` from `kz_records` `r` group by `r`.`map`,`r`.`comm` order by NULL;

